create table relevance_testings
(
    id               bigserial,
    results_part_1   json,
    results_part_2   json,
    results_part_3   json,
    user_id          bigint,
    created_at       timestamp,
    updated_at       timestamp,
    model_name       text,
    query_slug       text,
    model_variant    varchar(40),
    article_category varchar(20)
);

alter table relevance_testings
    owner to postgres;

